async function insertDownload() {
  var url = window.location.href
  var output = url.split("?v=")[1].split("&")[0]
  while(!document.querySelector("div#info > #menu-container > #menu > ytd-menu-renderer > #top-level-buttons")) {
    await new Promise(r => setTimeout(r, 500));
  }
  var menu = document.querySelector("div#info > #menu-container > #menu > ytd-menu-renderer > #top-level-buttons");
  console.log(menu);
  var a = document.createElement("a");
  ytdl.getInfo(url, {quality : "lowest"}).then((o) => {a.setAttribute('href', o.formats[0].url)});
  a.setAttribute('target', '_blank');
  a.setAttribute('style', 'padding-left:5px; padding-right:5px ;margin:auto; color: #AAAAAA; font-size: var(--ytd-caption_-_font-size);font-size: 150%; font-weight:bold; text-decoration:none;');
  a.innerHTML = "⇩ Download";
  menu.insertBefore(a, menu.children[2]);
  console.log(output);  
}

function loadstate() {
  chrome.storage.sync.get("ytd_state", function(items) {
      enabled = items['ytd_state'];
      if(enabled){
          if(window.location.href.includes("?v=") && window.location.href.includes("youtube")){
              insertDownload()
            }
          }
  });
}

window.onload = loadstate;

chrome.extension.onMessage.addListener(function(request, sender, sendResponse) {  
	if(request.content) {
    sendResponse({content: "response message"});
    setTimeout(function() {
        insertDownload();
    }, 1000);
      
      
		return true; // This is required by a Chrome Extension
	}
})